entity16510.addComponent(new NFTdata(entity16510, "0xb932a70A57673d89f4acfFBE830E8ed7f75Fb9e0", "9321", "SuperRare network - Sphere layout", "HEX6C", "At 11:20:48 PM (UTC) of April 5th, 2018, the first piece was tokenized on SuperRare. It is -AI Generated Nude Portrait #1- by Robbie Barrat. About 30 minutes later (precisely at 11:50:12 PM), Artnome (Jason Bailey) bought the artwork for 0.46Ξ ($176 at that time). Recently, Artnome accepted a bid of 75.0Ξ ($13,265) from CuriousNFTs. Since today is the second birthday of SuperRare, I decided to generate this small series with four networks. Using SuperRare data until today, I built a buyer/creator network where the nodes of the network are the active users of SuperRare (those that made at least one sale, or at least one purchase, or that created at least one piece of art), and the links between nodes are drawn as follows. Suppose there is a sale from seller A to buyer B of a token T, where C is the artist that created artwork T. Then, I add an undirected link between B (the buyer) and C (the creator) to the network. The added link represents an endorsement of buyer B to artist C. The resulting graph contains 605 nodes and 4894 edges. The graph has been generated using ggraph library of R in four different layouts (random, circle, sphere and Sugiyama) and exported in high resolution SVG. All networks are available also in black color on white background upon request.", "Artwhale"))
