entity15528.addComponent(new NFTdata(entity15528, "0xb932a70A57673d89f4acfFBE830E8ed7f75Fb9e0", "9488", "Schotter — Take IV", "HEX6C", "This piece is inspired by the work Schotter (Gravel) by Georg Nees (1968). Georg Nees is considered one of the founders of computer art and graphics. Nees studied mathematics and physics at the universities of Erlangen-Nuremberg and Stuttgart. He subsequently worked for Siemens as a software engineer, and was instrumental in their purchasing a ‘Zuse Graphomat’, a drawing machine operated by computer-generated punched tape. The machine was capable of creating geometric patterns and, although the programming language that Nees used (ALGOL) was designed specifically for scientific computers, Nees used it to create aesthetic images such as this one. Nees was interested in the relationship between order and disorder in picture composition. In the artwork Schotter he introduced random variables into the computer program, causing the orderly squares to descend into chaos. Schotter — Take IV is part of the Generative Art Recoded Project (GARP). This is an effort to preserve pioneering generative artworks by translating them into a modern programming language (Processing). Indeed, in most cases, the original code underlying these early masterpieces got lost, unfortunately. My goal is also to offer a learning resource of Processing for both art and science students using the same challenging process I followed: (1) start from the original artwork; (2) reverse engineer the code; (3) match the outcomes of the code with the original artwork and possibly tune the code accordingly; (4) tweak the code to obtain derivative versions of the original. Some of the derivative works I obtained, including the reversed code itself, are tokenized as non-fungible tokens. Therefore, they are saved and preserved on an immutable and, hopefully, eternal distributed ledger (Ethereum).", ""))
