entity15888.addComponent(new TextData(entity15888, "Hackatao", "Art Gallery at [15,43]", "Hackatao Gallery  Hackatao is an artists duo born in Milan in 2007.  -Hack- for the pleasure of doing under the skin and discovering what's hidden inside: -Tao- for Yin and Yang, their creative dynamic balance.  When these two very different but complementary souls met, a very unique style came into being. The combination of an exctra detailed drawn parts and & colorful painted flat style is what guided the artists through the evolution of their arts until today. After exploring sculpture, canvas and different techniques, in April 2018, digital and blockchain came on the scene and would never again abandon the artists. Hackatao quickly became flourishing in teh crypto art scene and soon they were considered amongst the top artists pioneering the space.  Animating their physical works and experimenting with any sort of digital tools and artistic medium, Hackatao's art pieces are often involved with the main issues of society, environment, humanity and crypto. As well as references to art history, symbolism and psychology.  Always in a very unique, unmistakable Hackatao's style. "))
